import React from "react";
import styled from "styled-components";

// 여긴 투두 아이템 들어가는곳
const TodoItem = ({ todo }) => {
  return (
    <div key={todo.id}>
      {todo.map((todo) => {
        return <div>{todo.text}</div>;
      })}
    </div>
  );
};

export default TodoItem;
